;\n	this->addChild(sv,1000);\n이렇게 사용\n','','완료',0),(274,'수정','현수','영호','게임 실행하고 오프닝 끝나고 메인맵 진입시 무조건 다음 대화가 열리도록 할것\n\n[엘레베르(난쟁이)] 이봐.. 일어나.. 일어나보라구..\n\n[케이(남자)] 음냐… 음.. 누.. 누구?\n\n[스노우(백설공주)] 이제서야 깨어났군!! 당신때문에 우리엄마가 마녀에게 납치당해버렸잖아!!\n\n[케이] 뭐? 마녀? 무슨 이야기인지 하나도 모르겠네.. 여긴어디지?\n\n[엘레베르] 아직 정신을 못차렸나보군.\n이곳은 화이트왕국이라네. 아름다운 소나무들이 자라는 곳으로 유명하지.\n하지만 사흘전 갑자기 나타난 마녀가 우리 왕비마마를 납치해간 이후 왕국 곳곳엔 악령들이 득실되고 있어.\n이 사태를 해결하지 않으면 왕국자체가 악의 소굴로 변할 태세라네.\n모든일이 자네가 마녀의 봉인을 해제하면서 일어난 일이라네\n\n[케이] 아… 생각났다.. 그때 그 이상한 책을 열고.. 그래 어떤여자를 봤어요. 무서운 눈매의… 도무지 알수가 이해하기 힘든일들이…\n\n[악령] 쿠오오오아아앙\n\n[엘레베르] 이런 또 악령이 나타났구만. 일단 악령을 처치한후 이야기를 하지.','','완료',0),(276,'수정','현수','현수','오프닝스크립트넣기','','완료',0),(277,'수정','현수','영호','메인맵 책과 책 사이 워프','main_warp.ccbi 업로드했음.\n\nmain_warp.ccbi 에는 3가지 타임라인이 있음\nclose - 워프가 안열림(연결된 퍼즐이 안열려있을때)\nopen - 워프가 열리는 애니메이션 (스테이지를 클리어하여 다음 퍼즐이 열릴때)\nopened - 이미 연결된 퍼즐이 열려있을때, 이게 기본타임라인\n\n각 조건에 맞는 타임라인 실행해줄것.','완료',0),(278,'수정','현수','영호','보석뽑기\n\n일반뽑기 -  1등급 50%, 2등급 30%, 3등급20%\n고급뽑기 - 2등급 50%, 3등급 30%, 4등급 20%\n소셜뽑기 - 1등급 40%,2등급 30%, 3등급20%,4등급 10%','','완료',0),(279,'수정','현수','영호','메인맵자석효과\n\n맵의 스케일이 조절되는 구간에서 손을 놓았을경우 자동으로 해당 맵이 확대되어 보여지도록','ui가 바뀜','취소',0),(280,'수정','현수','현수','몬스터배치-벨런스','','alert',0),(281,'수정','현수','영호','중간중간스토리(마녀 이전 작업 완료)','드롭박스>기획>story_script.rtf 참고하여\n\n스토리 배치하기\n\n(영호 - 마녀 이미지 만들어지면 이후 작업 들어갈 수 있음)','alert',0),(282,'수정','현수','영호','스테이지점선','','완료',0),(283,'수정','현수','영호','게임끝나고 별박고, 다음스테이지오픈','','완료',0),(284,'수정','현수','영호','다음퍼즐오픈','','완료',0),(285,'수정','현수','정순','메인UI(캐릭터, 뷰티스톤) 넘겨주기','완료후 \n\n상태 - 알림(alert)\n담당자 - 영호\n\n로 변경하여 저장해주세요.','alert',0),(286,'수정','영호','영호','클리어 보상 연출','','완료',0),(287,'수정','정순','영호','메인ui 수정','','완료',0),(288,'수정','현수','영호','메인>콜렉션 - 카드강화 버튼 삭제\n메인>콜렉션>카드선택 - 카드강화버튼 삭제','','완료',0),(289,'수정','정순','영호','클리어창 별 세개뜨게 하기','','완료',0),(290,'수정','현수','영호','게임시작창(아이템구입)화면에서 마지막내구도 경고 뜨는것 지우기','','완료',0),(291,'수정','정순','영호','책 가운데 라인','','완료',0),(292,'수정','nhn','현수','전체 랭킹에서 하트보내기로 text수정','','완료',0),(293,'수정','nhn','정순','상점>스톤상점 에서 \n\n\"xx랭크 카드 출현\" > \"xx 랭크 스톤출현\" 으로 수정','','alert',0),(294,'수정','nhn','정순','상점> 코인상점\n에서 \"코인상점\" 을 하트 상점으로 수정\n\n코인모양 아이콘을 하트모양으로 수정','','alert',0),(295,'수정','nhn','영호','스테이지 시작 아이템구매 창에서\n\n스테이지번호수정하기','','완료',0),(296,'수정','현수','영호','warp클릭시 이전 스테이지 또는 다음 스테이지로 가도록','','완료',0),(297,'수정','현수','영호','보상 화면에 골드도 이미지 띄워주기','','완료',0),(298,'수정','경수','경수','전체공격 터지고 바로 사라지게.','','완료',0),(300,'수정','현수','현수','벨런스백업시스템','','alert',0),(302,'수정','경수','현수','join(회원가입) 하는 명령어 만들어야 됨','만들고 영호한테 적용 부탁해야됨\n\n지금 최초 getUserData 하면 GDDONTFIND 뜨니까 해결이 필요함.','완료',0),(303,'수정','nhn','현수','사운드리스트','','완료',98),(304,'수정','nhn','현수','통합게임기획서','','대기',97),(305,'수정','nhn','현수','환경조사서','','완료',99),(306,'수정','nhn','현수','timeLimit','','완료',95),(307,'수정','nhn','현수','체크리스트 완료일정','','대기',96),(308,'수정','nhn','현수','디비스키마 작성해서 넘겨주기','','완료',0),(309,'수정','경수','경수','레이저 파괴 영역 겹친다고 함.','','완료',0),(310,'수정','경수','경수','KSLabelTTF 버그 수정.','','완료',0),(311,'수정','경수','경수','보스 공격저지 텍스트 완성시키기','','완료',0),(312,'수정','경수','경수','운석패턴 소리 패턴공격시작할때 한번만 들리는데 운석떨어질때마다 소리나도록','','완료',0),(313,'수정','경수','경수','소리 캔슬하기','','완료',0),(314,'수정','경수','경수','피회복 없애기','','완료',0),(315,'수정','경수','경수','사운드 끊고 재생하는거 만들기 iscomment','','완료',0),(316,'수정','경수','경수','미사일 하나더 쎈거 나온다고 함.','','완료',0),(317,'수정','경수','경수','fmod 조사하기','','완료',0),(318,'수정','경수','경수','스크롤 콘트롤도 가능하게 해야됨.','','완료',0),(319,'수정','현수','경수','스테이지세팅창(아이템구매창)에서 미사일업글하는 부분 보스를 타격하는듯하게 바꾸기','','완료',0),(320,'수정','정순','경수','#선물함\n받은 메세지가 없을때에는 모두수락 버튼 숨기기\n스크롤 배경 만들기 (design3/_multi/폴더안 cardsetting_scroll.png 이미지 이용하여 스크린샷 참고하여 만들기)','','완료',0),(321,'수정','경수','영호','재시작을 하면 가능한 제일 높은 스테이지로 가버리는 버그','','대기',0);
